import React from "react";

function List({ pokedata }) {
  return (
    <div>
      <h1>{pokedata}</h1>;
      <ul>
        {pokedata.map(pokemon => {
          return <li>{pokemon.name}</li>;
        })}
      </ul>
    </div>
  );
}

export default List;
